    a1 = (h1 + h2) / (h1 * h2);
    a0 = -(2*h1 + h2) / (h1 * (h1 + h2));
    Y0 = (dY0 - a2 * Y2 - a1 * Y1) / a0;

function Y0 = leftdYl(h1, h2, Y1, Y2, lambda)
    a2 = -h1 / (h2 * (h1 + h2));
    a1 = (h1 + h2) / (h1 * h2);
    a0 = -(2*h1 + h2) / (h1 * (h1 + h2));
    Y0 = -(a2 * Y2 + a1 * Y1) / (a0 - 1 / lambda);

function Y0 = leftddYz(h1, h2, Y1, Y2)
